	As shown in Table 3, BiLSTM gives significantly ${trendWord (model_ "BiLSTM")._Acc (model_ "LSTM")._Acc betterWorse} accuracies compared to uni-directional LSTM2, with the training time per epoch ${trendWord (model_ "BiLSTM")._Time_s (model_ "LSTM")._Time_s growShrink} from ${(model_ "LSTM")._Time_s} seconds to ${(model_ "BiLSTM")._Time_s} seconds. Stacking 2 layers of BiLSTM gives ${trendWord (model_ "2 stacked BiLSTM")._Acc (model_ "BiLSTM")._Acc improvements} to development results, with a ${trendWord (model_ "2 stacked BiLSTM")._Time_s (model_ "BiLSTM")._Time_s smallerHigher} time of ${(model_ "2 stacked BiLSTM")._Time_s} seconds. 3 layers of stacked BiLSTM ${trendWord (model_ "3 stacked BiLSTM")._Acc (model_ "BiLSTM")._Acc improve} the results. In contrast, S-LSTM gives a development result of ${(model_ "S-LSTM")._Acc} %, which is significantly ${trendWord (model_ "S-LSTM")._Acc (model_ "2 stacked BiLSTM")._Acc betterWorse} compared to 2-layer stacked BiLSTM, with a ${trendWord (model_ "S-LSTM")._num_Param (model_ "2 stacked BiLSTM")._num_Param smallerHigher} number of model parameters and a ${trendWord (model_ "S-LSTM")._Time_s (model_ "2 stacked BiLSTM")._Time_s shorterLonger} time of ${(model_ "S-LSTM")._Time_s} seconds.  We additionally make comparisons with stacked CNNs and hierarchical attention (Vaswani et al., 2017), shown in Table 3 (the CNN and Transformer rows), ${(findWithKey_ "_Time_s" (minimum (map (fun y -> y._Time_s) tableData)) tableData)._Model} is the ${rankLabel "most efficient" (findIndex "_Model" "CNN" (insertionSort (fun a b -> a._Time_s < b._Time_s) tableData))} among all models compared, with the [REPLACE ]model size. On the other hand, a 3-layer stacked CNN gives an accuracy of81.46%, which is also the"lowest"compared with BiLSTM, hierarchical attention and S-LSTM. The"best"performance of hierarchical attention is obtained by S-LSTM+Attention in terms of both accuracy and efficiency. S-LSTM gives significantly"better"accuracies compared with both CNN and hierarchical attention. Table 3 additionally shows the results of BiLSTM and S-LSTM when external attention is used. Attention leads to improved accuracies for both BiLSTM and S-LSTM in classification, with S-LSTM still"outperforming"BiLSTM significantly.
"""","imports":["import util

let ordinalMap = [
    { lastDigit: 1, suffix: "st" },
    { lastDigit: 2, suffix: "nd" },
    { lastDigit: 3, suffix: "rd" }
];

let ordinal n =
   if n <= 0 then error "n <= 0 not supported"
   else if (n < 4) then
      numToStr n ++ (findWithKey_ "lastDigit" n ordinalMap).suffix
   else if (n >= 4) `and` (n <= 20) then numToStr n ++ "th"
   else error "n > 20 not supported";

let rankLabel word n =
   (if n == 1 then "" else ordinal n ++ "-") ++ word;

let countOrd e l g (EQ : xs) = countOrd (e + 1) l g xs;
    countOrd e l g (LT : xs) = countOrd e (l + 1) g xs;
    countOrd e l g (GT : xs) = countOrd e l (g + 1) xs;
    countOrd e l g Nil = [e, l, g];

let overallComparison orders =
    let [countEQ, countLT, countGT]  = countOrd 0 0 0 orders
    in if (countEQ >= countLT) `and` (countEQ >= countGT) then EQ
        else if countLT > countGT then LT
        else GT;

let compareCols columnA columnB tableRow =
   compare tableRow.[columnA] tableRow.[columnB];

let distributionOutlier val avg stdDev numOfDev =
   if (avg - numOfDev * stdDev <= val) `and` (val <= avg + numOfDev * stdDev) then EQ
   else if avg - numOfDev * stdDev > val then LT
   else GT;

let trendWord n1 n2 compareWord =
    compareWord (compare n1 n2);

let growShrink EQ = "unchanging";
    growShrink LT = "shrinking";
    growShrink GT = "growing";

let smallerHigher EQ = "equal";
    smallerHigher LT = "smaller";
    smallerHigher GT = "larger";

let improve EQ = "does not further improve";
    improve LT = "does not further improve";
    improve GT = "further improves";

let improvements EQ = "no further improvements";
    improvements LT = "no further improvements";
    improvements GT = "further improvements";

let shorterLonger EQ = "identical";
    shorterLonger LT = "shorter";
    shorterLonger GT = "longer";

let betterWorse EQ = "equal";
    betterWorse LT = "worse";
    betterWorse GT = "better";

let underOverPerforming EQ = "performing the same as";
    underOverPerforming LT = "performing worse than";
    underOverPerforming GT = "outperforming";

let unusuallyHighLow EQ = "mostly equal";
    unusuallyHighLow LT = "unusually low";
    unusuallyHighLow GT = "unusually high";

let aHigherLower EQ = "an equivalent";
    aHigherLower LT = "a lower";
    aHigherLower GT = "a higher";

let aReducedIncreased EQ = "the same";
    aReducedIncreased LT = "a reduced";
    aReducedIncreased GT = "an increased";

let underOverPerformed EQ = "performed the same as";
    underOverPerformed LT = "performed worse than";
    underOverPerformed GT = "outperformed";
","let insert lt x [] = [x];
    insert lt x (y : ys) =
       if x `lt` y
       then x : y : ys
       else y : insert lt x ys;

let insertionSort lt lst =
   let helper [] sorted = sorted;
       helper (x : xs) sorted = helper xs (insert lt x sorted)
   in helper lst [];

let findIndex fName x [] = -1;
    findIndex fName x (y : ys) =
       if y.[fName] == x then 1
       else findIndex fName x ys + 1;

let findWithKey_ fName x table =
   fromSome (findWithKey fName x table);

let findWhere pred table =
   fromSome (find pred table);

let model m t = findWithKey_ "_Model" m t;

let maximumBy f [] = error "Empty list!";
    maximumBy f (x : xs) =
      let helper [] current = current;
          helper (y : ys) current =
            helper ys (if f y > f current then y else current)
      in helper xs x;

let getColumn columnName = map (fun x -> x.[columnName]);

let mean xs = sum xs / length xs;

let standardDev avg xs =
   (sum (map (fun x -> (x - avg) ** 2) xs) / length xs - 1) ** 0.5;

let stats xs =
   let avg = mean xs
   in [avg, standardDev avg xs];
